Украинская делегация прибыла к месту переговоров.

В офисе Зеленского заявили, что в в состав группы входят:

- министр обороны Украины Алексей Резников;
- глава фракции «Слуга Народа» Давид Арахамия;
- советник руководителя офиса президента Михаил Подоляк;
- первый замглавы делегации Украины в Трехсторонней контактной группе Андрей Костин;
- заместитель министра иностранных дел Украины Николай Точицкий;
- народный депутат Рустем Умеров.

Подчеркивается, что ключевой вопрос переговоров - немедленное прекращение огня и вывод войск с территории Украины.

