Компания BP заявляет, что избавляется от своей доли в «Роснефти». Глава BP Бернард Луни выходит из совета директоров российской компании.

Доля BP в капитале «Роснефти» составляет 19,75%. Накануне Луни вызывали в кабинет министра по делам бизнеса, энергетики и промышленной стратегии Великобритании.

