Об этом заявила глава Еврокомиссии. Решение касается как пассажирских самолётов, так и частных бизнес-джетов.

@pdmnews

Baza: гендиректор авиакомпании «Победа» Андрей Калмыков покинул Россию в день начала операции на Украине. По данным источника, он улетел с семьёй в Швейцарию, а на посту его замещает технический директор.

Пресс-секретарь «Победы» не ответила на звонок «Подъёма», личный телефон самого Калмыкова находится вне зоны действия сети.

