СМИ сообщают, что в аэропорту Гостомеля уничтожен крупнейший в мире транспортный самолёт Ан-225 «Мрия». Между тем, первые сообщения об уничтожении «Мрии» появились ещё 24 февраля, тогда эта информации не нашла подтверждения.

Сейчас об уничтожении самолёта заявил глава города Буча Анатолий Федорук.

