Германия уже с понедельника начнёт поставки оружия Украине. Об этом заявил посол ФРГ в Киеве.

Ранее верховный представитель ЕС по иностранным делам и политике безопасности Жозеп Боррель предложит Совету ЕС профинансировать поставки Украине летальных вооружений и топлива.

