Хоккейный клуб «Динамо Рига» вышел из КХЛ. Об этом говорится в официальном Twitter команды.

Клуб выступал в Континентальной хоккейной лиге с 2008 года. По итогам регулярного чемпионата этого сезона команда занимала последнее место в таблице. Ранее с розыгрыша «Кубка Гагарина» снялся финский «Йокерит».

