Сборная Чехии по футболу не будет проводить возможный стыковой матч с Россией за право участия в Чемпионате мира в Катаре. Такое же решение до этого приняли сборные Польши и Швеции.

Бельгия и Исландия присоединились к странам, закрывшим своё воздушное пространство для российских самолётов.

