Депутат Госдумы от «Единой России» Евгений Попов и РБК анонсировали новое обращение Владимира Путина по ситуации на Украине. Дмитрий Песков заявил РИА Новости, что президент не планирует такого обращения.

Между тем, глава российской делегации в Гомеле Владимир Мединский заявил, что Россия будет ждать ответа Украины по переговорам до 15:00 по белорусскому времени.

@pdmnews

Дмитрий Песков заявил, что Гомель как место переговоров выбран Киевом. По словам пресс-секретаря президента, российскую делегацию возглавил Владимир Мединский, в ближайшее время он сделает соответствующее заявление.

«Со своей стороны предупредили украинскую сторону, что на этот раз мероприятия, предусмотренные ходом ведения военной операции, приостанавливаться не будут - так, как было сделано вчера, о чем мы вас проинформировали накануне», - добавил Песков.

