В Минобороны РФ заявили, что Чернобыльскую АЭС охраняют бойцы ВДВ России вместе с военнослужащими Национальной гвардии Украины.  

В ведомстве подчеркивают, что персонал продолжает работу. Уровень радиации замеряют шесть раз в день. 

