Кадыров опубликовал видео с бойцом, устанавливающим флаг Чечни на ограде. Рядом виднеется украинский флаг на земле. Где был снят ролик, не указывается.  

Ранее глава Чечни написал: «Я официально заявляю, что самые горячие точки на Украине будут проходить именно чеченские бойцы, которые служат на пути Первого Президента ЧР, Героя России Ахмата-Хаджи Кадырова. Мне показывали некоторые ролики, в которых националисты бросают им вызов. Заявляю, если вы хотите встретиться с нами, то с удовольствием приглашаем встретить нас там».

@pdmnews

Комендантский час в Киеве будет действовать с 17.00 до 08.00. 

Всех гражданских, которые будут на улице в это время, будут считать диверсантами.

