Минобороны РФ заявляет, что жилой дом в Киеве был поражён ракетой комплекса Бук-М1 вооружённых сил Украины.

«Очевидно, что в ходе отражения ночного ракетного обстрела объектов военной инфраструктуры ВСУ Украины произошел отказ в системе наведения ракеты украинского ЗРК средней дальности “Бук-М1” и ракета задела угол жилого дома».

