Дмитрий Медведев заявил о возможности возврата смертной казни в России. Так зампредседателя Совета Безопасности Российской Федерации прокомментировал приостановку членства РФ в Совете Европы.

«Хорошая возможность восстановить ряд важных институтов для предотвращения особо тяжких преступлений в стране — типа смертной казни для опаснейших преступников, которая, кстати, активно применяется в США и Китае».

