Минобороны РФ сообщает, что взятых в плен на Змеином украинских пограничников привезли в Севастополь. 

По заявлению ведомства, 82 военнослужащих Украины планируют отправить домой. Ранее власти Украины заявляли о гибели всего гарнизона.

